import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Navbar from './avbar';  // Assuming Navbar is directly under src as well
import Footer from './Footer';  // Assuming Footer is directly under src as well
import Home from './Home';     // Home.js is directly under src
import About from './About';   // About.js is directly under src
import Projects from './Projects';  // Projects.js is directly under src
import TechStack from './TechStack';  // TechStack.js is directly under src

const App = () => {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/projects" element={<Projects />} />
        <Route path="/techstack" element={<TechStack />} />
      </Routes>
      <Footer />
    </Router>
  );
};

export default App;
